    <>
      <p>ボタンAを0回押しました!</p>
      <button>ボタンA</button>
      <p>ボタンBを10回押しました!</p>
      <button>ボタンB</button>
      <p>ボタンCを100回押しました!</p>
      <button>ボタンC</button>
    </>
  );
};

export default Example;
